import React from 'react';

function MessageList({ messages }) {
  return (
    <div>
      <h2>메시지 목록</h2>
      <ul>
        {messages.map(message => (
          <li key={message.message_no}>
            <div>
              <strong>보낸 사람:</strong> {message.sender_no}
            </div>
            <div>
              <strong>내용:</strong> {message.message_content}
            </div>
            <div>
              <strong>보낸 날짜:</strong> {message.send_date}
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default MessageList;
